import axios from 'axios';

const axiosApi = axios.create({
	baseURL: 'https://api.themoviedb.org/3/',
	httpsAgent: confirm,
	headers: {
		'Access-Control-Allow-Origin': '*',
		'Content-Type': 'text/plain',
	},
});

export default axiosApi;
